import React from 'react';
import {
    BrowserRouter as Router,
    Routes,
    Route,
    Link
  } from "react-router-dom";

import classes from './AddInterview.module.css';
import CreateInterview from '../Form/CreateInterview';
import App from '../../App';

const AddInterview = (props) => {

    return (
        <Router>
            <div>
                <Link to="/createInterview">Create Interview</Link>
                <Routes>
                    <Route exact path="/">
                        <App />
                    </Route>
                    <Route exact path="/createInterview">
                        <CreateInterview />
                    </Route>
                </Routes>
                {/* <Button className={classes.addInterviewButton} onClick={addInterviewHandler}>Create Interview</Button> */}
            </div>
        </Router>
    );
};

export default AddInterview;
